			/**
			 * Initialize map
			 * @return It returns no object.
			 */
			function initializeMap() {
				
				var canvas = $("#map_canvas").get(0);
				var latlng = new google.maps.LatLng(mapCenter.lat, mapCenter.lng);
				var map = new google.maps.Map(canvas, {
					zoom: 16,
					center: latlng,
					mapTypeId: google.maps.MapTypeId.ROADMAP
				});
				
				// for all portals
				for (var i = 0; i < portals.length; i++) {
					// get a portal object
					var portal = portals[i];
					// if guid is nothing, skip the portal
					if (portal == null || portal.guid == null) {
						continue;
					}
					// console
					console.log(portal.name);
					// get position
					var m_latlng = new google.maps.LatLng(portal.lat, portal.lng);
					// create marker image
					var image = new google.maps.MarkerImage(
						getMarkerImage(portal.team),
						new google.maps.Size(25.0, 41.0),
						new google.maps.Point(0.0, 0.0),
						new google.maps.Point(12.5, 41.0)
					);
					// create marker shadow
					var shadow = new google.maps.MarkerImage(
						getMarkerImage("S"),
						new google.maps.Size(46.0, 41.0),
						new google.maps.Point(0.0, 0.0),
						new google.maps.Point(12.5, 41.0)
					);
					// create marker (draw marker)
					var marker = new google.maps.Marker({
						position: m_latlng,
						map: map,
						shadow: shadow,
						icon: image,
						title: "[L" + getLevelInt(portal.level) + "]" + portal.name
					});
					// attach info window of marker
					var message = "<dl class='infoWindow'>"
						        + "<dt>" + portal.name + "</dt>"
						        + "<dd>"
						        + "<img src='" + portal.imageUrl + "'/>"
						        + "Alignment: " + getTeamString(portal.team) + "<br/>"
						        + "Level: " + portal.level + "<br/>"
						        + "</dd></dl>";
					attachInfoWindow(portal.guid, marker, message);
				}
			}
			
			// bind maps load event
			google.maps.event.addDomListener(window, 'load', initializeMap);
			
			/**
			 * Get marker image from team code
			 * @param team You set "R", "E", "X" as team code.
			 * @return It returns image resource or image url.
			 */
			function getMarkerImage(team) {
				if (team === "R" || team === "E" | team === "X" | team === "S") {
					return markerIcon[team];
				} else {
					// otherwise unknown
					return markerIcon["U"];
				}
			}
			
			/**
			 * Attach info window to marker
			 * @param guid You set unique id(GUID) you want to attach info window.
			 * @param marker You set marker object you want to attach info window.
			 * @param message You set message string you want to attach info window.
			 */
			function attachInfoWindow(guid, marker, message) {
				// create description
				var infoWindow = new google.maps.InfoWindow({
					content: message
				});
				// bind marker click event
				google.maps.event.addListener(marker, 'click', function() {
					// if info window has already shown, the info window force to close
					if (guid in shownInfoWindows) {
						shownInfoWindows[guid].close();
						delete shownInfoWindows[guid];
					} else {
						infoWindow.open(marker.getMap(), marker);
						shownInfoWindows[guid] = infoWindow;
					}
				});
			}
			
			/**
			 * Get team string
			 * @param team You set "R", "E", "X" as team code.
			 * @return It returns "Registance", "Enlightened", "Free" or "Unknown" as string.
			 */
			function getTeamString(team) {
				if (team === "R") {
					return "Registance";
				} else if (team === "E") {
					return "Enlightend";
				} else if (team === "X") {
					return "Free";
				} else {
					return "Unknown";
				}
			}
			
			/**
			 * Get level as integer
			 * @param levelReal You set real level. (ex. 0.25)
			 * @return It returns level as integer. (ex. 1)
			 */
			function getLevelInt(levelReal) {
				// 0.00 = L0, 0.01~0.99 = L1
				if (levelReal < 1.00) {
					return Math.ceil(levelReal);
				}
				// round down
				return Math.floor(levelReal);
			}
			// ready html contents
			$(function() {
				// fit canvas height to window
				var windowHeight = $(window).height();
				$("#map_canvas").css("height", windowHeight + "px");
				initializeMap();
				// if window resize, fit canvas height to window
				$(window).resize(function() {
					var windowHeight = $(window).height();
					$("#map_canvas").css("height", windowHeight + "px");
					initializeMap();
				});
				
				$("#info").css({fontSize:"0.8em"}).text("Update: " + updateDateTime + " - " + portals.length + " portals loaded.");
			});
		</script>
